import React from 'react';
import { Route, Switch } from 'react-router-dom'
import Navbar from './components/navbar';

function App() {
  return (
    <div className="container">
    <Navbar />
      <Switch>
        <Route path='/' exact component={ExerciseList}/>
      </Switch>
    </div>
  );
}

export default App;
